import React, { useEffect, useState } from 'react';
import Axios from 'axios';

const NewTable = () => {
    const [tableName, setTableName] = useState("");

    const addTable = () => {
        Axios.post(`http://localhost:3001/createTable/${tableName}`, {
            tableName: tableName
        })
        .then(response => {
            console.log('Table created successfully');
            // Optionally, you can handle any UI updates or redirects here after successful table creation
        })
        .catch(error => {
            console.error('Error creating table:', error);
            // Optionally, you can handle error states or display error messages to the user
        });
    };

    return (
        <div>
            <label>Add Workout</label>
            <input type="text" value={tableName} onChange={(event) => setTableName(event.target.value)}/>
            <button onClick={addTable}>Create Workout</button>
        </div>
    );
};

export default NewTable;
